import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Card from './components/Card'


export default function Priority1()
{
//   const [array, setarray] = useState([]);
  const [data, setData] = useState(null);
  const [card_list_Urgent, setcard_list_Urgent] = useState([]) 
  const [card_list_High, setcard_list_High] = useState([])
  const [card_list_Medium, setcard_list_Medium] = useState([])
  const [card_list_Low, setcard_list_Low] = useState([])
  const [card_list_Nopriority, setcard_list_Nopriority] = useState([])

  const fetchData = async () => {
    try {
      const response = await axios.get('https://api.quicksell.co/v1/internal/frontend-assignment');
      setData(response.data.tickets);
    } catch (error) {
      console.error('Axios error:', error);
    }
  };

  const add_card = () => {
    // const newArray = [...array];
    const newcardlist_Urgent=[...card_list_Urgent];
    const newcardlist_High=[...card_list_High];
    const newcardlist_Medium=[...card_list_Medium];
    const newcardlist_Low=[...card_list_Low];
    const newcardlist_Nopriority=[...card_list_Nopriority];


    for (const item of data) {
   
        if(item.priority==0)
        {
        newcardlist_Nopriority.push(<Card name={item.id} desc={item.title}></Card>)
        // newArray.push(item);
        }
        
        else if(item.priority==1)
        {
        newcardlist_Low.push(<Card name={item.id} desc={item.title}></Card>)
        }

        else if(item.priority==2)
        {
        newcardlist_Medium.push(<Card name={item.id} desc={item.title}></Card>)
        }
   
        else if(item.priority==3)
        {
        newcardlist_High.push(<Card name={item.id} desc={item.title}></Card>)
        }

        else if(item.priority==4)
        {
        newcardlist_Urgent.push(<Card name={item.id} desc={item.title}></Card>)
        }
        
   
   
   
    }
    // setarray(newArray);
    setcard_list_Nopriority(newcardlist_Nopriority);
    setcard_list_Low(newcardlist_Low);
    setcard_list_Medium(newcardlist_Medium);
    setcard_list_High(newcardlist_High);
    setcard_list_Urgent(newcardlist_Urgent);

  };

  useEffect(() => {
    fetchData();
  }, []);



  
  useEffect(() => {
    if (data) {
      add_card();
    }
  }, [data]);

//   console.log('array', array);



    return (
    <div style={{display:"flex",backgroundColor:"rgb(154, 172, 178)",height:"100%"}}>
      
<div style={{width:"20%"}}>No priority {card_list_Nopriority}</div>
<div id='Urgent' style={{width:"20%"}}>Urgent {card_list_Urgent} </div>
<div id='High' style={{width:"20%"}}>High {card_list_High}</div>
<div id='Medium' style={{width:"20%"}}>Medium {card_list_Medium}</div>
<div id='Low' style={{width:"20%"}}>Low {card_list_Low}</div>


    </div>
  )
}
